import React from 'react'
import './style.css'

function Navbar (props){
    return (
        <div id ='navbar'>
            <h1 className="header">Certified Atms</h1>
            {console.log(props)}
            <button className="tabs" onClick={() => props.changeComponent('home')}>Home |</button>
            <span className="tabs" onClick={() => props.changeComponent('email')}>Email |</span>
            <span className="tabs" onClick={() => props.emailForm()}>Machines |</span>
        </div>
    )
}



export default Navbar;
